import{_ as e,c as r,a8 as l,o as t}from"./chunks/framework.BDnHobkS.js";const n=JSON.parse('{"title":"Vehicle Types & Setup","description":"","frontmatter":{},"headers":[],"relativePath":"uk/airframes/index.md","filePath":"uk/airframes/index.md"}'),i={name:"uk/airframes/index.md"};function s(o,a,p,h,f,c){return t(),r("div",null,a[0]||(a[0]=[l('<h1 id="vehicle-types-setup" tabindex="-1">Vehicle Types &amp; Setup <a class="header-anchor" href="#vehicle-types-setup" aria-label="Permalink to &quot;Vehicle Types &amp; Setup&quot;">​</a></h1><p>PX4 підтримує численні типи транспортних засобів, включаючи різні конфігурації мультикоптерів, літаків, засобів вертикального злету та посадки(VTOL), наземних засобів, тощо.</p><p>Цей розділ пояснює, як збирати, конфігурувати та налаштовувати системи автопілотів на основі PX4 для кожного типу (багато з цих налаштувань є спільними для всіх типів).</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p><a href="./../getting_started/px4_basic_concepts.html#drone-types">Основні поняття &gt; Типи дронів</a> надають високорівневу інформацію про типи транспортних засобів і випадки використання, для яких вони найкраще підходять.</p></div><h2 id="підтримувані-транспортні-засоби" tabindex="-1">Підтримувані транспортні засоби <a class="header-anchor" href="#підтримувані-транспортні-засоби" aria-label="Permalink to &quot;Підтримувані транспортні засоби&quot;">​</a></h2><p>Типи рам, які мають розробників, добре тестовані та підтримуються:</p><ul><li><a href="./../frames_multicopter/">Багатокоптери</a> (три-, чотири-, шести-, восьми- та навіть <a href="./../frames_multicopter/omnicopter.html">омнікоптерні</a> транспортні засоби)</li><li><a href="./../frames_plane/">Літаки (Фіксоване крило)</a></li><li><a href="./../frames_vtol/">VTOL</a>: <a href="./../frames_vtol/standardvtol.html">Стандартний VTOL</a>, <a href="./../frames_vtol/tailsitter.html">VTOL з вертикальним зльотом</a>, <a href="./../frames_vtol/tiltrotor.html">VTOL з поворотними гвинтами</a></li></ul><h2 id="експериментальні-апарати" tabindex="-1">Експериментальні апарати <a class="header-anchor" href="#експериментальні-апарати" aria-label="Permalink to &quot;Експериментальні апарати&quot;">​</a></h2><p>Експериментальні рами - це ті типи транспортних засобів, які:</p><ul><li>У неї немає технічного обслуговування.</li><li>Не регулярно тестується головною командою розробки.</li><li>Можливо, не тестуються в CI.</li><li>Не має необхідних характеристик для готових до виробництва засобів.</li><li>Може не підтримувати деякі загальні конфігурації для типу транспортного засобу.</li></ul><p>Наступні типи транспортних засобів вважаються експериментальними:</p><ul><li><a href="./../frames_airship/">Дирижаблі</a></li><li><a href="./../frames_autogyro/">Автожири</a></li><li><a href="./../frames_balloon/">Повітряні кулі</a></li><li><a href="./../frames_helicopter/">Вертоліт</a></li><li><a href="./../frames_rover/">Марсохід</a></li><li><a href="./../frames_sub/">Субмарини</a></li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Волонтери та контрибютори, <a href="./../contribute/">внесення</a> нових функцій, нових конфігурацій каркасів або інших вдосконалень дуже вітається!</p></div><h2 id="інші-транспортні-засоби" tabindex="-1">Інші транспортні засоби <a class="header-anchor" href="#інші-транспортні-засоби" aria-label="Permalink to &quot;Інші транспортні засоби&quot;">​</a></h2><p>Повний набір підтримуваних типів транспортних засобів і їх конфігурації можна знайти в <a href="./../airframes/airframe_reference.html">Airframes</a>.</p>',15)]))}const u=e(i,[["render",s]]);export{n as __pageData,u as default};
